import './Content3.css';

export default function Content3() {
 
  return (
    <div className='thirdpara'>
    <div id="captioned-gallery">
	<figure class="slider">
		<figure>
			<img src={surplus1} alt='img'/>
			<figcaption>India, New Delhi</figcaption>
		</figure>
		<figure>
			<img src={surplus2} alt='img'/>
			<figcaption>India, Mumbai</figcaption>
		</figure>
		<figure>
			<img src={surplus3} alt='img'/>
			<figcaption>India, Lucknow</figcaption>
		</figure>

		
	</figure>
</div>
    </div>
  )
}
